import { useState, useEffect } from "react";
import axios from "axios";

// This is the single most important change for React
axios.defaults.withCredentials = true;

function App() {
  const [inputs, setInputs] = useState({
    age: "30",
    gender: "1",
    ap_hi: "120",
    ap_lo: "80",
    cholesterol: "1",
    gluc: "1",
    smoke: "0",
    alco: "0",
    // We remove height, weight, and bmi as they come from Google Fit
  });
  
  const [output, setOutput] = useState(null);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isLoading, setIsLoading] = useState(false);

  const handleChange = (e) => {
    setInputs({ ...inputs, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {
    setIsLoading(true);
    setOutput(null); // Clear previous results
    try {
      // We are now sending credentials (cookies) with this request
      const res = await axios.post(
        "http://localhost:5000/predict_fit",
        inputs,
        {
          headers: { "Content-Type": "application/json" },
          // We can also set it here per-request
          // withCredentials: true, 
        }
      );
      setOutput(res.data);
      setIsLoggedIn(res.data.is_logged_in);
    } catch (err) {
      console.error(err);
      alert(
        "Error fetching prediction. Make sure Flask backend is running and CORS is allowed."
      );
    }
    setIsLoading(false);
  };
  
  // Optional: Check login status on page load
  useEffect(() => {
    // We can make a GET request to the same endpoint to check auth
    // and get default data
    const checkLogin = async () => {
      try {
        const res = await axios.get("http://localhost:5000/predict_fit");
        setIsLoggedIn(res.data.is_logged_in);
        setOutput(res.data); // Show default data on load
      } catch (err) {
        console.error("Could not connect to backend", err);
      }
    };
    checkLogin();
  }, []); // Empty array means this runs once on component mount


  return (
    <div style={{ padding: "20px", fontFamily: "Arial", maxWidth: "800px", margin: "auto" }}>
      <h1>üíì Hridamrit Heart Risk Prediction</h1>
      
      {!isLoggedIn && (
        <div style={{ padding: '20px', backgroundColor: '#fff0f0', border: '1px solid red', borderRadius: '8px', marginBottom: '20px' }}>
          <p>You are not logged in with Google Fit. Predictions will use default data.</p>
          <a
            href="http://localhost:5000/login"
            style={{
              padding: "10px 15px",
              fontSize: "16px",
              color: "white",
              backgroundColor: "#007bff",
              textDecoration: "none",
              borderRadius: "5px",
              display: "inline-block"
            }}
          >
            Login with Google Fit
          </a>
        </div>
      )}

      <h3>Enter your details:</h3>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(150px, 1fr))",
          gap: "15px",
          marginBottom: "15px",
        }}
      >
        {Object.keys(inputs).map((key) => (
          <div key={key}>
            <label style={{ textTransform: "capitalize" }}>{key}:</label>
            <br />
            <input
              type="number"
              name={key}
              value={inputs[key]}
              onChange={handleChange}
              style={{ width: "100%", padding: "8px", boxSizing: 'border-box', borderRadius: '5px', border: '1px solid #ccc' }}
            />
          </div>
        ))}
      </div>
      
      <button
        onClick={handleSubmit}
        disabled={isLoading}
        style={{
          padding: "10px 20px",
          fontSize: "18px",
          cursor: "pointer",
          backgroundColor: "#28a745",
          color: "white",
          border: 'none',
          borderRadius: '5px'
        }}
      >
        {isLoading ? "Calculating..." : "Get Prediction"}
      </button>

      {output && (
        <div
          style={{
            marginTop: "30px",
            display: "grid",
            gridTemplateColumns: "1fr 1fr",
            gap: "20px",
          }}
        >
          {/* Fit Data Card */}
          <div
            style={{
              border: "1px solid #ccc",
              padding: "15px",
              borderRadius: "10px",
              backgroundColor: "#f9f9f9",
            }}
          >
            <h3>üìä Fit Data {isLoggedIn ? "(Live)" : "(Defaults)"}</h3>
            <p>Steps (avg/day): {output.fit_data.avg_steps.toFixed(1)}</p>
            <p>Calories (avg/day): {output.fit_data.avg_calories.toFixed(1)}</p>
            <p>Height: {output.fit_data.height.toFixed(2)} m</p>
            <p>Weight: {output.fit_data.weight.toFixed(1)} kg</p>
          </div>

          {/* Prediction Result Card */}
          <div
            style={{
              border: "1px solid #ccc",
              padding: "15px",
              borderRadius: "10px",
              backgroundColor: output.predicted_class === 1 ? "#ffe6e6" : "#e6ffed",
            }}
          >
            <h3>ü©∫ Prediction Result</h3>
            <p style={{fontSize: '1.2em', fontWeight: 'bold'}}>
              Risk: {output.predicted_class === 1 ? "High Risk" : "Low Risk"}
            </p>
            <p>Probability of High Risk: {(output.probability * 100).toFixed(2)}%</p>
          </div>

          {/* Manual Input Card */}
          <div
            style={{
              border: "1px solid #ccc",
              padding: "15px",
              borderRadius: "10px",
              backgroundColor: "#eef6ff",
              gridColumn: "1 / -1" // Spans full width
            }}
          >
            <h3>üìù Inputs Used for Model</h3>
            <pre style={{whiteSpace: 'pre-wrap', wordBreak: 'break-all'}}>
              {JSON.stringify(output.manual_input, null, 2)}
            </pre>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
